{%1=app name} Standards is a program that rewards merchants for providing great customer experiences. {%1=app name} tracks a variety of metrics, including user ratings of the merchant's items, refunds, fulfillment, and compliance with {%1=app name} policies, to determine a merchant's ranking: Platinum, Gold, Silver, and Bronze. {%2=link to more details}

Platinum and Gold tiered merchants are assigned a Premier Merchant badge upon meeting or exceeding certain thresholds. A breakdown of the merchant performance categories and underlying metrics is detailed below. The formula or method for monitoring, classifying, or reporting on merchant performance, including performance criteria and minimum scores, may be updated over time.

Our premier merchants offer highly-rated products, reliable shipping, and products that are loved by customers. These performance categories are based on underlying metrics. For instance, "Highly Rated Products" are supported by the product's average rating. "Reliable Shipping" is determined by a merchant's order fulfillment rate, time to confirmed fulfillment, valid tracking rate, and logistics refund rate. "Loved by customers" is based on average product rating, product quality refund rate, and buyer retention rate.
